 Deed to Andorhal' from inside Andorhal Townhall at 43.35, 69.3., and give it to Magistrate Marduke at 70.5, 74.0.\n8.2 Loot 'Bucket of Fountain Water' from the candylit fountain at 68.9, 78.8., and give it to Joseph Dirte at 68.0, 74.8.\n8.3 Loot 'Trampled Doll' from the meatwagon in Darrowshire at 35.7, 83.5. (Eastern Plaguelands!), return to Caer Darrow and give it to Sammy at 69.15, 78.7.\n8.4 Loot 'The Road Ahead' from a wall inside old Corin's Crossing tavern  at 55.0, 64.0. (Eastern Plaguelands!), return to Caer Darrow and give it to Artist Renfray at 65.8, 75.4.\n8.5 Loot 'Undelivered Shipment of Smokes' from a wagon behind the fountain at King's Square in Stratholme, return to Caer Darrow and give it to Rory at 63.4, 75.5.\n\n9. Use Eva's Journal to begin the ritual at 69.7, 71.7., inside Caer Darrow keep/open world Scholomance.",mapID=306,maps={307,308,309},sourceQuests={76249},type="a",g={h(-12,{awp=100105,g={ach(18368,{maps=a[393],sourceQuests={76249}}),ach(18558),gach(5054,{awp=40003})}}),h(-45,{awp=100105,g={q(8259,{altQuests={8258},awp=10700,c=a[831],coords={a[554]},qgs=a[187],r=1,rwp=40003,sourceQuests={7668},u=2,g={s(7977,20134,{b=1,f=6,modID=1,u=2})}}),q(7666,{c=a[359],coords={a[545]},qgs={928},r=2,repeatable=1,rwp=40003,sourceQuests={7647},u=2,g={i(18746,{spellID=23204,u=2})}}),q(7669,{c=a[831],coords={a[554]},qgs=a[187],r=1,repeatable=1,rwp=40003,sourceQuests={8258},u=2,g={i(18746,{spellID=23204,u=2})}}),q(27140,{awp=40003,qgs=a[614],rwp=50004,u=2}),q(5803,{coords={{42.7,83.8,22}},qgs=a[119],qis={14610},r=2,rwp=40003,sourceQuests={5801},u=2}),q(5804,{coords={a[935]},maps=a[396],qgs=a[120],qis={14610},r=1,rwp=40003,sourceQuests={5802},u=2}),q(5343,{coords={a[593]},qgs=a[115],qis=a[190],r=2,rwp=40003,u=2}),q(5341,{coords={a[934]},maps=a[396],qgs=a[114],qis=a[190],r=1,rwp=40003,u=2}),q(27143,{awp=40003,qgs=a[613],qis=a[190],rwp=50004,u=2,g={i(65923,{b=1,f=53,modID=1,spellID=93742,u=2})}}),q(5531,{coords={{81.73,57.83,23}},qgs=a[117],qis={13761},rwp=