t portion of the room, use the Krastinov's Bag of Horrors toy. When you do, the ghost of Eva Sarkhoff will spawn, afraid of you (as the toy transforms you into the Butcher himself). Removing the toy's buff will make Eva realize you're not her murderer, and she will talk to you, giving you the old Spectral Essence trinket and allowing you to loot Eva's Femur on the ground. This allows you to see ghosts in Caer Darrow.\n\nOnce you do, you can talk to Eva at her old spot outside Scholomance, where she will request you to look for her journal, as well as five candles, to perform a horrible ritual. The candles are traded from citizens in Caer Darrow, and require items they treasured when alive. Below, we have the locations for all items:",maps=a[393]}),q(5463,{coords={a[923]},description="Take the Keepsake to the symbol on the floor in Baron Rivendare's room in Stratholme.",maps=a[511],qgs=a[117],qis={13585},rwp=40003,sourceQuests={5462},u=2}),q(5464,{maps=a[511],providers={{"o",176631}},qis={13624},rwp=40003,sourceQuests={5463},u=2}),q(5538,{coords={a[587]},cost={{"i",14628,1},{"g",150000}},qgs=a[119],r=2,rwp=40003,sourceQuests={5537},u=2}),q(5514,{coords={a[935]},cost={{"i",14628,1},{"g",150000}},maps=a[396],qgs=a[120],r=1,rwp=40003,sourceQuests={964},u=2}),q(5529,{coords={{81.47,59.66,23}},qgs=a[116],rwp=40003,u=2}),q(27145,{awp=40003,qgs=a[613],rwp=50004,u=2}),q(5533,{coords={{42.7,84,22}},qgs={10838},r=2,rwp=40003,sourceQuests={5097},u=2}),q(838,{coords={{83.1,68.9,18}},qgs={10837},r=1,rwp=40003,sourceQuests={5098},u=2}),q(27148,{awp=40003,qgs={45108},rwp=50004,u=2,g={s(33340,65974,{b=1,f=23,modID=1,u=2}),s(33296,65925,{b=1,f=5,modID=1,u=2}),s(33319,65950,{b=1,f=6,modID=1,u=2}),i(65995,{b=1,f=52,modID=1,u=2})}}),q(5537,{coords={a[587]},qgs=a[119],qis={14619},r=2,rwp=40003,sourceQuests={5533},u=2}),q(964,{coords={a[935]},maps=a[396],qgs=a[120],qis={14619},r=1,rwp=40003,sourceQuests={838},u=2}),q(5465,{coords={a[923]},qgs=a[117],qis={13624},rwp=40003,sourceQuests={546