rlina's room - Instead of taking a left to enter the boss room, take a right. Page is hidden beneath some spider eggs.",sourceQuests=a[877],g={i(206452,{b=1,questID=76293,type="ihqt",g={crit(60651,{achID=18616,id=3})}})}}),o(403705,{description="Pages 7 and 8 of Omarion's Notes can be found in Maexxna's Room. Once you enter the room, turn back to face the entrance and look up, there will be a grapple point just above the entrance. Grapple and walk around the outer ring to the eastern end of the room, where the notes will be waiting for you.",sourceQuests=a[876],g={i(206453,{b=1,questID=76294,type="ihqt",g={crit(60652,{achID=18616,id=4})}})}}),o(403706,{description="Pages 9 and 10 of Omarion's Notes can be found just before the tunnel that leads to Gluth. Before you enter the tunnel, by the pipe after Grobbulus, there will be a grapple point. Simply grapple to it to reach the note.",sourceQuests=a[876],g={i(206454,{b=1,questID=76295,type="ihqt",g={crit(60653,{achID=18616,id=5})}})}}),o(403707,{description="Pages 11 and 12 of Omarion's Notes can be found in Grobbulus's room. Climb the ramp behind the boss and turn back, you will see a grappling point to a small alcove near the ceiling of the room. Grapple there and walk to the end of the alcove to reach the note.",sourceQuests=a[876],g={i(206455,{b=1,questID=76296,type="ihqt",g={crit(60654,{achID=18616,id=6})}})}}),o(403708,{description="Pages 13 and 14 of Omarion's Notes can be found high on the ceiling on the corridor after Patchwerk. To reach the page, start by grabbing a grapple point by the tunnel leading to Gluth, at the broken portion to the left just before dropping to the boss, then follow a small grappling puzzle to get to the page.",sourceQuests=a[876],g={i(206456,{b=1,questID=76297,type="ihqt",g={crit(60655,{achID=18616,id=7})}})}}),o(403709,{description="Pages 15 and 16 of Omarion's Notes can be found in Thaddius's room, by grappling on your way to Zackett Skullsmash.",sourceQuests=a[876],g={i(206457,{b=1