,isRaid=1,mapID=186,maps={187,188,189,190,191,192,193,699,1359},savedInstanceID=631,g={ah(49623,{c=a[58],description="These quests can only be completed on 25-Man Normal or Heroic difficulty.",isRaid=1,type="i",g={q(24545,{c=a[58],lvl=30,maps={115},minReputation=a[143],qgs=a[548],qis={49869},g={o(201937,{coords={{75.9,20.8,115}}})}}),q(24743,{lvl=30,qgs=a[548],sourceQuests={24545},g={s(24432,49888,{b=1,c=a[58],f=22,lvl=30,spellID=71168})}}),q(24547,{lvl=30,qgs=a[548],sourceQuests={24743}}),q(24749,{lvl=30,qgs=a[548],sourceQuests={24547}}),q(24756,{lvl=30,qgs=a[548],sourceQuests={24749}}),q(24757,{lvl=30,qgs=a[548],sourceQuests={24756}}),q(24548,{description="These can drop from any of the bosses on 25-Man Normal or Heroic. You need 50 of these, so this quest will take you several weeks to finish.",lvl=30,qgs=a[548],sourceQuests={24757}}),q(24912,{lvl=30,qgs=a[548],sourceQuests={24548}}),q(24549,{lvl=30,qgs=a[548],sourceQuests={24548},g={s(24303,49623,{b=1,c=a[58],f=22,lvl=30,spellID=71903}),ach(4623,{c=a[58]})}}),q(24748,{lvl=30,qgs=a[548],sourceQuests={24549}}),i(51315,{b=1,c=a[58],description="Dropped by the Lich King on 25-Man difficulty while on the quest |cFFefc400The Lich King's Last Stand|r. Only your first kill will trigger the item to drop. You do NOT need to have Shadowmourne equipped.\n\nThis item contains a lot of BoE cosmetic items that sell very well. During its time, this was used to reward other members of the raid for assisting the guild master (more than likely) with Shadowmourne for the many months it took to complete the quest chain.\n\nIn addition to being very rewarding, these quests were some of the most treasured throughout World of Warcraft's long history.",lvl=30,providers={{"i",51316}},qgs={36597},questID=24914,sourceQuests={24549},g={i(51317,{b=1,description="Alexandros: Darion, my son. At last I am able to lay my eyes upon you again. The Lich King tormented me without end, Darion. Endlessly he sought to break my will, to force me to serve him, to bind me to his blade. Finally, when events demanded his full attention, he left me. The one memory I clung to Darion, the one thought that kept me from giving in, it was your sacrifice, my son. That again saved me from eternal peril.\n\nDarion: Father, father, I… I feared for your sanity, father, for you, I would give my life a thousand times.",lvl=30,questID=24915,g={mnt(73313,{b=2,itemID=52200,lvl=10})}}),i(51319,{b=1,description="Muradin: Oh lad, how I missed those endless days in Lordaeron, sharpening your skill with this dull blade. Forging you into a weapon meant to withstand the demands of a great destiny. Heh… You sure put them skills to use, didn't you lad?\n\nIf only I'd been able to stop you that day, how different things migha' been. If only I'da never discovered that accursed blade. Farewell, Arthas, my brother.",lvl=30,questID=24917,g={toy(52201,{lvl=10})}}),i(51320,{b=1,description="Uther: Arthas... Alas, hero of Azeroth. You give me a greater gift than you know. Long have I struggled to forgive the prince for his terrible transgressions. My soul has been wracked with unbearable anxiety, dark thoughts, distancing me from the light.\n\nI recall clearly... the gleam of pride in his eye as he stood before me, eager to defeat the enemies of the light... eager to defend his people, no matter the cost. It is this memory of Arthas that I choose to keep in my heart.\n\nI shall always be in your debt, friend. Thank you.",lvl=30,questID=24919,g={s(25723,52252,{f=9,lvl=30,spellID=73326})}}),i(51321,{b=1,description="Sylvanas: So, it is done. I had not dared to trust my senses. Too many times has the Lich King made me to be a fool. Finally, he has been made to pay for the atrocities he imposed upon my people.\n\nMay Azeroth never fail to remember the horrible price we paid for our weakness, for our pride. But what now, Hero? What of those freed from his grasp but still shackled to their mortal coils?\n\nLeave me. I have much to ponder.",lvl=30,questID=24918,g={toy(52253,{lvl=10})}}),i(51318,{b=1,description="Jaina: What's this?\nHe... he kept it.. all this time he kept it!\n<Cries> I knew!\n<Cries> I sensed a part of him still alive... trapped... struggling. Oh Arthas!\nPerhaps he might someday remember from what he once was...\nBy the Light may he at last find rest, free from the icy grip of that terrible blade!",lvl=30,questID=24916,g={i(52251,{collectible=false,lvl=30,spellID=73324})}}),i(51316,{b=1})}})}}),h(-12,{ach(4602,{awp=30002,g={mnt(72808,{awp=30300,b=1,itemID=51954,lvl=27})}}),ach(4603,{awp=30002,g={mnt(72807,{awp=30300,b=1,itemID=51955,lvl=27})}}),ach(4532),ach(4608),ach(4636),ach(4637),ach(4598,{minReputation=a[144],g={title(141)}}),ach(11753,{awp=70200,g={crit(36414,{achID=11761,id=35})}}),ach(4576,{awp=30303,providers={{"n",36597}},rwp=30305,u=2})}),h(-31,{faction(1156)}),h(-45,{q(24815,{description="If the quest does not appear when you hit Friendly, you may have to relog.",lvl=30,minReputation=a[143],qgs=a[556],g={i(50375,{b=1,c=a[58],f=52,spellID=71653}),i(50377,{b=1,c=a[347],f=52,lvl=30,spellID=71581}),i(52569,{b=1,c=a[58],f=52,spellID=73961}),i(50376,{b=1,c=a[486],f=52,lvl=30,spellID=71650}),i(50378,{b=1,c=a[347],f=52,lvl=30,spellID=71655})}}),q(24827,{c=a[58],lvl=30,minReputation=a[145],qgs=a[556],sourceQuests=a[435],g={i(50388,{b=1,c=a[58],f=52,lvl=30,spellID=71653})}}),q(24834,{c=a[58],lvl=30,minReputation=a[142],qgs=a[556],sourceQuests={24827},g={i(50403,{b=1,c=a[58],f=52,lvl=30,spellID=71653})}}),q(24835,{c=a[58],lvl=30,minReputation=a[144],qgs=a[556],sourceQuests={24834},g={i(50404,{b=1,c=a[58],f=52,lvl=30,spellID=71653})}}),q(24828,{c=a[347],lvl=30,minReputation=a[145],qgs=a[556],sourceQuests=a[435],g={i(50384,{b=1,c=a[347],f=52,lvl=30,spellID=71581})}}),q(24823,{c=a[347],lvl=30,minReputation=a[142],qgs=a[556],sourceQuests={24828},g={i(50397,{b=1,c=a[347],f=52,lvl=30,spellID=71581})}}),q(24829,{c=a[347],lvl=30,minReputation=a[144],qgs=a[556],sourceQuests={24823},g={i(50398,{b=1,c=a[347]