his is a Horde city!|r You can get here using the ship service from Echo Isles in Durotar. From the Port of Zuldazar, fly eastwards to the southfacing building entrances. Above the transmogifier shop is the Yojamba Exchange, where you can turn in the quest at Rin'wosho the Trader.\n\n10. Zul'Gurub is now unlocked for your account, and the vendor Rin'Wosho with his wares can now be found at the beginning of the dungeon.\n\n11. Protip: Start the Gurubashi Tribute farm as early as possible as it is a decent source for coins. See the header for Brazier of Madness for more information.",type="a",g={h(-12,{ach(17367,{crit(58126,{achID=17367,providers={{"i",203743}}}),crit(58125,{achID=17367,providers={{"i",203742}}})}),ach(17366,{sourceQuests={74576}})}),ah(203757,{cost={{"i",203773,1},{"i",203772,1},{"i",203771,1},{"i",203770,1},{"i",203769,1},{"i",203768,1},{"i",203767,1},{"i",203766,1},{"i",203765,1}},description="To get started farming Gurubashi Tributes for recipes:\n\n1. Go to the site of the boss Cache of Madness.\n\n2. By the eastern wall is an altar. Here hangs Tablet of Madness, which teaches Alchemists with 300 skill points in classic alchemy how to create Gurubashi Mojo Madness.\n\n3. On the left side of the altar is an interactable brazier, which gives you the toy Brazier of Madness.\n\n4. The four main bosses Venoxis, Mandokir, Kilnara and Zanzil have piles of skull near them. Use the toy Blazier of Madness near one of these piles, and consume a Gurubashi Mojo Madness. This will transform you to a troll for one hour, and make you able to interact with the different piles of skulls to offer bijous for Gurubashi Tributes. The transformation will make you friendly to the mobs in the dungeon, so this should be done after killng the bosses.\n\n5. The different piles requires different bijous, and rewards 1-2 recipes and/or 3-7 coins. For more information see the header for Gurubashi Tribute.",type="i",g={i(203959,{b=1,description="Venoxis' available offerings: 2x Silver Bijou / 3x Green Bijou / 3x Gold Bijou. Coords: 51.5, 55.8 Behind the Boss\n\nMandokir's available offerings: 2x Bronze Bijou / 3x Red Bijou / 3x Gold Bijou. Coords: 60.8, 80.9 Right side of Boss\n\nKilnara's available offerings: 2x Orange Bijou / 3x Yellow Bijou / 3x Gold Bijou. Coords: 47.5, 22.1 Behind Boss at the wall\n\nZanzil's available offerings: 2x Purple Bijou / 3x Blue Bijou / 3x Gold Bijou. Coords: 30.4, 19.9 North side of the Boss room, at the left wall.",modID=2,g={r(402139,{itemID=203838,learnedAt=300,requireSkill=333}),r(402150,{itemID=203847,learnedAt=300,requireSkill=165}),r(402134,{itemID=203833,learnedAt=300,requireSkill=164}),r(402135,{itemID=203834,learnedAt=300,requireSkill=164}),r(402130,{itemID=203831,learnedAt=300,requireSkill=164}),r(402128,{itemID=203829,learnedAt=300,requireSkill=164}),r(402124,{itemID=203826,learnedAt=300,requireSkill=164}),r(402133,{itemID=203861,learnedAt=300,requireSkill=164}),r(402137,{itemID=203836,learnedAt=300,requireSkill=164}),r(402141,{itemID=203840,learnedAt=300,requireSkill=773}),r(402143,{itemID=203842,learnedAt=300,requireSkill=165}),r(402144,{itemID=203843,learnedAt=300,requireSkill=165}),r(402151,{itemID=203848,learnedAt=300,requireSkill=197}),r(402615,{itemID=203968,learnedAt=300,requireSkill=165}),r(402146,{itemID=203844,learnedAt=300,requireSkill=165}),r(402152,{itemID=203849,learnedAt=300,requireSkill=197}),r(402155,{itemID=203850,learnedAt=300,requireSkill=197}),r(402147,{itemID=203845,learnedAt=300,requireSkill=165}),r(402148,{itemID=203846,learnedAt=300,requireSkill=165}),r(402156,{itemID=203851,learnedAt=300,requireSkill=197}),r(402136,{itemID=203835,learnedAt=300,requireSkill=164}),r(402123,{itemID=203825,learnedAt=300,requireSkill=164}),r(402126,{itemID=203828,learnedAt=300,requireSkill=164}),r(402118,{itemID=203824,learnedAt=300,requireSkill=164}),r(402125,{itemID=203827,learnedAt=300,requireSkill=164}),r(402138,{itemID=203837,learnedAt=300,requireSkill=164}),r(402131,{itemID=203832,le